    return(
        <dashboard_styled>
            <InnerLayout>
                All Transactions
                <div className='stats_container'>
                    <div className='chart_container'>
                        <Chart/>       
                    </div>
                </div>
            </InnerLayout>
        </dashboard_styled>
    )
}
const dashboard_styled = Styled.div`

`;
export default dashboard;
